package nablarch.core.cache.example;

public class ExampleData {

    private String id;
    private String name;
    /**
     * idを取得する。
     * @return id
     */
    public String getId() {
        return id;
    }
    /**
     * idをセットする。
     * @param id セットするid。
     */
    public void setId(String id) {
        this.id = id;
    }
    /**
     * nameを取得する。
     * @return name
     */
    public String getName() {
        return name;
    }
    /**
     * nameをセットする。
     * @param name セットするname。
     */
    public void setName(String name) {
        this.name = name;
    }

    
}
